// dist/lib/paginate.js
async function paginate(action, args = {}, limit = 100, wrapper = "", queries = []) {
  let pageNumber = 0;
  let results = [];
  let total = 0;
  while (true) {
    const offset = pageNumber * limit;
    const response = await action({
      ...args,
      queries: [
        ...queries,
        JSON.stringify({ method: "limit", values: [limit] }),
        JSON.stringify({ method: "offset", values: [offset] })
      ]
    });
    if (wrapper === "") {
      if (response.length === 0) {
        break;
      }
      results = results.concat(response);
    } else {
      if (response[wrapper].length === 0) {
        break;
      }
      results = results.concat(response[wrapper]);
    }
    total = response.total;
    if (results.length >= total) {
      break;
    }
    pageNumber++;
  }
  if (wrapper === "") {
    return results;
  }
  return {
    [wrapper]: results,
    total
  };
}

